// Name: Extendable Blocks
// ID: cst1229extendable
// Description: Blocks with a variable number of inputs.
// By: CST1229 <https://scratch.mit.edu/users/CST1229/>

;(function (window, Scratch) {
  function hijack(fn) {
    const _orig = Function.prototype.apply
    Function.prototype.apply = function (thisArg) {
      return thisArg
    }
    const result = fn()
    Function.prototype.apply = _orig
    return result
  }

  Scratch.translate.setup({
    'zh-cn': {
      'cst1229extendable.name': '可扩展积木',
      'cst1229extendable.join': '连接',
      'cst1229extendable.createjsonarray': '创建 JSON 数组',
      'cst1229extendable.runbranch': '运行第 [BRANCH] 个分支',
      'cst1229extendable.if': '如果',
      'cst1229extendable.ifelseif': '如果',
      'cst1229extendable.switch': '匹配 [VALUE]',
      'cst1229extendable.and': '与',
      'cst1229extendable.or': '或',
      'cst1229extendable.then': '那么',
      'cst1229extendable.else': '否则',
      'cst1229extendable.elseif': '否则 如果',
      'cst1229extendable.case': '如果为',
      'cst1229extendable.default': '默认'
    },
    en: {
      'cst1229extendable.name': 'Extendable Blocks',
      'cst1229extendable.join': 'join',
      'cst1229extendable.createjsonarray': 'create json array',
      'cst1229extendable.runbranch': 'run branch [BRANCH] of',
      'cst1229extendable.if': 'if',
      'cst1229extendable.ifelseif': 'if',
      'cst1229extendable.switch': 'switch [VALUE]',
      'cst1229extendable.and': 'and',
      'cst1229extendable.or': 'or',
      'cst1229extendable.then': 'then',
      'cst1229extendable.else': 'else',
      'cst1229extendable.elseif': 'else if',
      'cst1229extendable.case': 'case',
      'cst1229extendable.default': 'default'
    }
  })

  const twBase64 =
    ''

  const twCode = new TextDecoder('utf-8').decode(
    Uint8Array.from(atob(twBase64), v => v.charCodeAt(0))
  )

  const ExtensionProxy = new Proxy(function () {}, {
    construct(_, argArray) {
      if (argArray.length !== 1) return {}
      const runtime = argArray[0]
      let vm = undefined
      let Blockly = undefined
      if (runtime._events['QUESTION'] instanceof Array) {
        for (const value of runtime._events['QUESTION']) {
          const v = hijack(value)
          if (v?.props?.vm) {
            vm = v?.props?.vm
            break
          }
        }
      } else if (runtime._events['QUESTION']) {
        vm = hijack(runtime._events['QUESTION'])?.props?.vm
      }
      if (!vm) throw new Error('tw2ccw cannot get Virtual Machine instance.')
      if (vm._events['EXTENSION_ADDED'] instanceof Array) {
        for (const value of vm._events['EXTENSION_ADDED']) {
          const v = hijack(value)
          if (v?.ScratchBlocks) {
            Blockly = v?.ScratchBlocks
            break
          }
        }
      } else if (vm._events['EXTENSION_ADDED']) {
        Blockly = hijack(vm._events['EXTENSION_ADDED'])?.ScratchBlocks
      }
      // start construction
      let registerResult = {}
      const scratchInstance = new Proxy(Scratch, {
        get(target, property) {
          if (property === 'vm') {
            return vm
          } else if (property === 'renderer') {
            return vm.runtime.renderer
          } else if (property === 'extensions') {
            return {
              unsandboxed: true,
              register: instance => {
                registerResult = instance
              }
            }
          }
          return Reflect.get(target, property)
        }
      })
      const windowProxy = new Proxy(window, {
        get(target, property) {
          if (property === 'Scratch') {
            return scratchInstance
          }
          if (property === 'ScratchBlocks') {
            return Blockly
          }
          const v = Reflect.get(target, property)
          if (typeof v === 'function') {
            return new Proxy(v, {
              apply(target, thisArg, argArray) {
                return Reflect.apply(
                  target,
                  thisArg === windowProxy ? window : thisArg,
                  argArray
                )
              }
            })
          }
          return v
        },
        has(target, property) {
          if (property === 'Scratch' || property === 'ScratchBlocks')
            return true
          return Reflect.has(target, property)
        }
      })
      const fn = new Function('Scratch', 'ScratchBlocks', 'window', twCode)
      fn(scratchInstance, Blockly, windowProxy)
      return registerResult
    }
  })
  Reflect.set(window, 'tempExt', {
    Extension: ExtensionProxy,
    info: {
      name: 'cst1229extendable.name',
      description: 'cst1229extendable.desc',
      extensionId: 'cst1229extendable',
      featured: true,
      disabled: false,
      iconURL:
        'data:image/svg+xml;base64,',
      insetIconURL:
        'data:image/svg+xml;base64,',
      collaboratorList: [
        {
          collaborator: 'CST1229@tw',
          collaboratorURL: 'https://scratch.mit.edu/users/CST1229/'
        },
        {
          collaborator: 'FurryR@GitHub',
          collaboratorURL: 'https://github.com/FurryR'
        }
      ]
    },
    l10n: {
      'zh-cn': {
        'cst1229extendable.name': '可扩展积木',
        'cst1229extendable.desc': '🐱 [Turbowarp 兼容层] 可扩展的积木！'
      },
      en: {
        'cst1229extendable.name': 'Extendable Blocks',
        'cst1229extendable.desc':
          '🐱 [Turbowarp compatibility layer] Extendable blocks!'
      }
    }
  })
})(window, Scratch)
